import React from "react";

function Login() {

    return (
        <div className="login">

            <div className="signup">
                <label>Full Name</label>
                <label>Email Address</label>
                <label>Enter password</label>
            </div>
            <div className="login"></div>

            <li className="">Login</li>

          
        </div>
      );
}

export default Login
